- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CIn 2009, the Fairfax County Democratic
    Committee enters a year with no federal candidates on the ballot unless a vacancy
    triggers  a special federal election. The Committee employs a full time Executive
    Director, whose time is more than 25 percent devoted to federal elections and
    candidates.  No other entity pays compensation for their employees to work for
    the committee. The Fairfax County Democratic Committee maintains both Federal
    and Non Federal accounts. Although the Committee has been allocating qualified
    joint administrative expenses, the funds in our Non Federal account are inadequate
    to transfer to the Federal Account for disbursements after October 1, 2008. This
    report does not allocate qualified administrative expenses, as no transfer is
    possible. Administrative expenses will be paid 100 percent with Federal account
    funds until the Non Federal account has a higher balance. When transfers of qualified
    administrative expenses resume, they will be allocated on a 15 percent Federal,
    85 percent Non Federal split, due to no federal elections scheduled this calendar
    year. The Committee does not engage in any fundraising on behalf of candidates
    for Federal office, so all of its reported fundraising expenses are party fundraising.
    The main purpose of this amendment is to align the corrected cumulative balance
    with the previously amended monthly reports from 2008. In addition, certain disbursements
    have been restated to clarify purposes of the expenses or to correct errors in
    original or amended classifications.\n"
